const CVList = ({ cvs, handleCVListIndex }) => {
  return ( 
    <select className="cv-list" name="cvlist" id="cv-select" onChange={handleCVListIndex(e.select.value)}>
      {cvs.map((cv) => {
        return <option value={cv._id}>{cv.title}</option>
      })}
    </select>
   );
}
 
export default CVList;
